
# Longest Increasing Subsequence
# http://rosalind.info/problems/lgis/

# Similar to Finding a Shared Motif









# Digits of Pi
# Note Exludes decimal place
pi = ''
pi = ''

def subs(x):
    dans = ''
    aans = ''

    td = ''
    ta = ''

    for i in range(1,len(x)):
        b = int(x[i])
        a = int(x[i-1])
        #print(b,a)

        # Ascending
        if b > a:

            # ASC Work
            ta = ta+str(b)

            # DSC Work
            if len(td) > len(dans):
                dans = td
                td = ''
            else:
                td = ''


        elif b < a:

            # ASC Work
            if len(ta) > len(aans):
                aans = ta
                ta = ''
            else:
                ta = ''


            #DSC Work
            td = td + str(b)


    return aans,dans








# Get Pi up to X digits
x = int(input())

newpi = pi[:x]
a,d = (subs(newpi))


for i in a:
    print(i,end=' ')
print()
for i in d:
    print(i,end=' ')










